const About = () => {
    return ( 
        <header>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                       
        <section className="Homepage_face">
            <div className="Portfolio_logo">
            <h1>Lalan Kumar</h1>
            </div>
            
        </section>
        </header>
    )
}

export default About
